import React, {Component} from 'react';
import {render} from 'react-dom';

class Enlarge_img extends Component {
    render() {
        console.log(this.props.value)
        return (
        //   <button className="square">
        //     {this.props.value}
        //   </button>
        <img src={this.props.value} />
        );
    }
}

export default Enlarge_img;
